# filename: ex237.rq

PREFIX dm:   <http://learningsparql.com/ns/demo#> 
PREFIX rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

CONSTRUCT { ?locationURI rdf:type dm:Place . }
WHERE 
{
  ?item dm:location ?locationValue .
